import {Stack, Heading, Flex } from "@chakra-ui/react"
import SignIn from '../components/sign-in/sign-in.component';
import SignUp from '../components/sign-up/sign-up.component';


export default function Home() {
  return (
    <Stack direction='column' spacing = '60px' mag margin={{base: '10px', md: '50px'}} marginTop={{base: '30px', md: '30px'}}>
      <Heading>Log In / Sign Up</Heading>
        <Flex direction={'row'} flexWrap={'wrap'} flexDirection='row'>
        <SignIn />
        <SignUp />
        
        </Flex>
    </Stack>
  )
}
